const allImgs = document.querySelectorAll('figure img');
// console.log(allImgs);
// remove the srcset attribute where webp is not supported:
function imgData(result, object) {
  object.forEach((img) => {
    const { srcset, src } = img.dataset;
    // eslint-disable-next-line no-console
    // console.log(`data-srcset is: ${srcset},\n src is: ${src}`);
    if (srcset && src) {
      // img.attributes.removeNamedItem('srcset');
      // src = srcset;
      // [srcset, src] = [src, srcset];
      img.setAttribute('src', `${srcset}`);
      // img.removeAttribute(srcset);
      // img.removeAttribute(src)
      console.log(srcset);
    }
  });
  // console.log(object);
}

/* eslint-disable no-unused-vars */
/* eslint-disable no-console */
/* eslint-disable no-undef */

function detectImageFormat() {
  Modernizr.on('webp', (result) => {
    if (result) {
      // supported
      console.log(`webp: ${result}, webp supported`);
    } else {
      console.log(`webp: ${result}, webp not supported`);
      // remove the srcset attributes so Safari will render only the jpg
      // and all the other browsers will render the srcset
      imgData(result, allImgs);
    }
  });
}

